import React from "react";
import Unity, { UnityContent, UnityContext } from 'react-unity-webgl'


function BulletInferno() {
    const { unityProvider } = UnityContext({
        loaderUrl: "build/BulletInferno.loader.js",
        dataUrl: "build/BulletInferno.data",
        frameworkUrl: "build/BulletInferno.framework.js",
        codeUrl: "build/BulletInferno.wasm",
    });

    return <Unity unityProvider={unityProvider} />;
}

export default BulletInferno
